  runUploader(event, target, index) {
    let frame = '';
    var attachment = '';
    frame = frame + target; // Create a new media frame

    frame = wp.media({
      title: 'Select or Upload Media Of Your Chosen Persuasion',
      button: {
        text: 'Use this media'
      },
      multiple: false // Set to true to allow multiple files to be selected

    });
    var self = this; // copy the reference

    frame.on('select', function () {
      // Get media attachment details from the frame state
      attachment = frame.state().get('selection').first().toJSON();
      self.setState({
        [target]: attachment.url
      });
    }); // Finally, open the modal on click

    frame.open();
  }

  static getDerivedStateFromProps(nextProps, prevState) {
    //console.log("gds:p:s", nextProps.defaultValues, prevState);
    let derivedState = {};

    if (nextProps.defaultValues && nextProps.defaultValues.id !== prevState.id) {
      //   Object.keys(prevState).forEach(k => {
      //     derivedState[k] = "";
      //   });
      return { ...nextProps.defaultValues
      };
    } //console.log("no state change");


    return null;
  }

